package Data;import java.util.List;public class IntentNLTK {    private String status;    private List<String> intents;    private double confidence;    public IntentNLTK() {    }    public String getStatus() {        return status;    }    public List<String> getIntents() {        return intents;    }    public double getConfidence() {        return confidence;    }    public void setStatus(String status) {        this.status = status;    }    public void setIntents(List<String> intents) {        this.intents = intents;    }    public void setConfidence(double confidence) {        this.confidence = confidence;    }    @Override    public String toString() {        return "IntentNLTK{" +                "status='" + status + '\'' +                ", intents=" + intents +                ", confidence=" + confidence +                '}';    }}